import React from "react";

const Project = ({ project }) => {
  const { id, name } = project;
  return (
    <div key={id.value}>
      <h1>Project {id.name}</h1>
      <h3>Name: {name.first + " " + name.last}</h3>
    </div>
  );
};

export default Project;
